import React from 'react';
import ReactDOM from 'react-dom';
import TriggerDemo from './TriggerDemo';  // Import your main entry component (TriggerDemo)

ReactDOM.render(
  <React.StrictMode>
    <TriggerDemo />  {/* Render your main component */}
  </React.StrictMode>,
  document.getElementById('root')  // This matches the <div id="root"></div> in index.html
);
